import { HeartOutlined } from "@ant-design/icons";
import { Card, Rate } from "antd";


const Comment = () => {
    return(
        <div>
            <Card
              title="Comment"
              bordered={false}
              style={{
                width: 300,
                marginLeft: 720, height: 550, width: 250
              }}
              
            >
               <p><Rate character={<HeartOutlined />} value={3} /></p>  
            </Card>
        </div>
    );
};

export default Comment;
